webpackJsonp([7701940959457],{7931:function(t,e){t.exports={data:{post:{html:'<p><a href="http://www.flickr.com/photos/papascott/1074092998/" title="Photo Sharing"><img src="http://farm2.static.flickr.com/1264/1074092998_43710fbaac.jpg" width="375" height="500" alt="CIMG0093.JPG" /></a></p>\n<p>At the duty-free shop at Keflavik airport, I found an Iceland sweater with a unique new technology that warms from both the inside and the outside simultaneously. It was a deal I could not resist.</p>\n<p><a href="http://www.flickr.com/photos/papascott/1073232835/" title="Photo Sharing"><img src="http://farm2.static.flickr.com/1055/1073232835_c5c8468e76.jpg" width="375" height="500" alt="CIMG0094.JPG" /></a></p>\n<p>Here\'s what the inside looks like. The label says something about "black death". I hope we won\'t be regretting my purchase.</p>',fields:{title:"Iceland Sweater",date:"10 Aug 2007",url:"https://papascott.de/2007-08-10-iceland-sweater/"}}},pathContext:{slug:"/2007-08-10-iceland-sweater/",prev:{fields:{title:"Water Monster",date:"07 Aug 2007",slug:"/2007-08-07-water-monster/"}},next:{fields:{title:"Vacation Over",date:"11 Aug 2007",slug:"/2007-08-11-vacation-over/"}}}}}});
